プレミアム ヴィダルサスーン ベースケア シャンプー 500ml<br>ブランド：ヴィダルサスーン<br>販売・製造元：P&G(プロクター・アンド・ギャンブル)<br><br>動くたび、ダイヤモンドのように輝く髪を演出するダメージ(枝毛・切れ毛)ケア用シャンプーです。<br>コンディショニング成分が髪１本1本をなめらかにし、根元から毛先まで髪表面を整えるので、どんなに動いても、髪が光を反射し、きらきらと輝く髪に。<br>贅沢に咲き匂うシャンパンブーケの香り。<br> <br><br><br><br>使用方法<br>ポンプ首部を片手で押さえながら、頭部をまわしてください。<br>最初は数回カラ押ししてください。<br> <br><br>使用上の注意<br>●頭皮に傷、はれもの、湿疹等のあるときは使わないでください。<br>●使用中や使用後に刺激等の異常が現れた時は使用を中止し、皮フ科専門医等にご相談されることをおすすめします。<br>●目に入ったときは、直ちに洗い流してください。<br>●乳幼児の手の届かない所に保管してください。<br> <br>成分<br>水、ラウレス-硫酸アンモニウム、ラウロアンホ酢酸Na、ジステアリン酸グリコール、コカミドプロピルベタイン、ラウリル硫酸アンモニウム、コカミドMEA、セタノール、香料、ジメチコン、ポリクオタニウム-10、クエン酸Na、クエン酸、水添ポリデセン、安息香酸Na、EDTA-2Na、メチルクロロイソチアゾリノン、メチルイソチアゾリノン、香料、キシレンスルホン酸アンモニウム、塩化Na<br> 原産国タイ シャンプー全部とは髪と頭皮についたホコリ・あせ・皮脂などの汚れを洗い流します。<br><br>日用品／ヘアケア／シャンプー／シャンプー ダメージ(枝毛・切れ毛)ケア用<br>JANコード： 4902430130653<br><br>CS：12<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
