Dental Dr. カーブ歯間ブラシ M 10本入<br>ブランド：デンタルドクター<br>販売・製造元：小林製薬<br><br>歯間の歯垢・食べカスを取り除き、虫歯・歯周病を防ぐことで歯の喪失予防を歯間からサポートする歯間ブラシです。<br>口腔内の形状に合わせたカーブのグリップ(柄)でI字型で使いにくかった奥歯にも楽に使えるカーブ型。<br>汚れをしっかりかき取れる高密度植毛ブラシを採用しました。<br>さらに、ワイヤーが折れにくいサポート構造。<br> <br><br><br>使用方法<br>1.鏡を見ながら、歯茎を傷つけないように歯間部にゆっくりと挿入し、細かく前後に動かして清掃して下さい。<br>2.使用後はよく水洗いし、乾燥させて下さい。<br> <br><br>使用上の注意<br>・歯間が狭く挿入しにくい場合は無理に差し込んだり、回転させないで下さい。<br>無理に使用されますと、歯や歯茎を痛めたり、ワイヤーの曲がり、折れ、毛抜け等のトラブルの原因になることがあります。<br>歯間が狭くブラシが入りにくい場合には、糸ようじをお使い下さい。<br>・ワイヤーは曲げずに使用して下さい。<br>曲げて使用されますとワイヤーが折れる原因となります。<br>・歯茎が弱っている場合は、出血することがありますが、毎日の使用でしだいに出血が少なくなってきます。<br>出血が続くようでしたら、使用を控え、歯科医に相談して下さい。<br>・本品は歯間清掃用ブラシですので、歯と歯の間の清掃以外の目的ではご使用にならないで下さい。<br> 材質柄：ポリプロピレン毛：ナイロンキャップ：ポリプロピレン耐熱温度：80度<br> 原産国インドネシア <br>日用品／オーラルケア／歯石・歯垢対策／歯間ブラシ<br>JANコード： 4987072080856<br><br>CS：72<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
