ハブラシだけでは落とせない、歯と歯とハグキの間（歯間）の汚れを効果的に除去出来るのが歯間ブラシです。今回は、特に奥歯の歯間に挿入しやすい様、形状をＬ字型にした歯間ブラシが新発売となります。またブラシ部は、挿入しやすい様、先端をやややわらか仕上げにしたＷ植毛となっており、挿入時の違和感を軽減させました。ハンドルカラーも２色展開となっており、家族での使い分けや、気分転換としてもご使用頂けます。<br>兼ねてより要望の多かった「Ｌ字型」歯間ブラシを、デンタルプロとしていよいよ新発売する事になりました！大好評を頂いております「デンタルプロ歯間ブラシＩ字型」同様、お客様に納得して頂けるクオリティでこの価格を実現しました。今後、ますます加速するであろう高齢化社会に向けて、ジャックスは［８０２０運動（８０歳で２０本の歯を残そう！）］を推進していきます。<br><br>デンタルプロ L字型歯間ブラシ サイズ2(SS)<br>2色のブラシ部先端に細い用毛で歯間に入りやすい歯間ブラシです。奥歯の歯間部に使いやすいL字型ハンドル。折れにくく、曲がりにくいステンレス合金ワイヤーを使用。しっかり保持しやすい八角形ハンドル。<br> 使用方法：歯グキを傷つけないよう歯間部三角ゾーン(歯と歯と歯グキを結ぶ部位)にゆっくり挿入し、前後に動かしてください。 使用上の注意・歯と歯のあいだが狭く、挿入しにくい場合は無理に差し込んだり、回転させないでください。無理にご使用されますと毛やワイヤーが抜ける場合があります。・ワイヤーを曲げてご使用されますと折れる原因となります。・使用後は流水で充分洗い、水を切って風通しの良いところに保管して下さい。・本品は歯間清掃用ブラシですので、歯と歯のあいだの清掃以外にご使用にならないでください。・ブラシの毛先がいたんできたら新しいブラシに交換してください。 <br>ご注意：色は2色(レモンイエロー、イエロー)ありますが選べません。  製品仕様●柄の材質：ポリエチレン●毛の材質：ナイロン●ワイヤーの材質：ステンレススチール●キャップの材質：ポリプロピレン  <br>販売_製造元： デンタルプロ<br>ブランド：デンタルプロ<br>JAN：4973227306025<br>CS：120<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
