デンターシステマ 歯間用デンタルブラシ SSサイズ(極細タイプ)<br>ブランド：デンターシステマ<br>販売・製造元：ライオン<br><br>歯周病菌の巣が形成されやすい奥歯の歯間も、しっかりブラッシングできる歯間ブラシです。<br>歯間部への挿入がスムーズで、耐久性にも優れた独自設計。<br>折れにくく曲がりにくい超高強度ワイヤー、ワイヤー強度を高める先細ノズルを採用。<br>コンパクトヘッドで口腔内で操作しやすく、ロングハンドルでしっかり握れます。<br>前歯部や歯周病多発部位である臼歯部などに最適な、極細タイプのSSサイズ。<br> <br><br><br>使用方法<br>1.歯間部にまっすぐ挿入し、数回往復させてください。<br>2.ブラシは頬側からだけでなく、舌側からも挿入して清掃するとより効果的です。<br>3.使用後はよく水洗いをして乾燥させてください。<br> 最小通過径0.8-1.0(mm)*サイズ表示は全日本ブラシ工業による通過径の自主規格に基づくものです。<br> <br><br>使用上の注意<br>●歯間部が狭く、挿入しにくい場合は無理に挿入しないでください。<br>歯や歯グキを傷めたり、ワイヤーの曲がり、折れの原因になります。<br>●ワイヤーは曲げずにお使いください。<br>繰り返し曲げると折れる原因となります。<br>●ブラシの毛先が乱れてきたり、ワイヤーに弾力性がなくなってきたら、新しいブラシと交換してください。<br>●歯グキの状態によっては、お使いはじめの時に出血することがあります。<br>出血が続くようでしたら、使用を控え、歯科医師に相談してください。<br> 柄の材質ポリプロピレン 毛の材質ナイロン 耐熱温度80度 キャップの材質ポリプロピレン <br>日用品／オーラルケア／歯石・歯垢対策／歯間ブラシ<br>JANコード： 4903301373063<br><br>CS：72<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
