区分：医薬部外品<br><br>加美乃素 薬用シャンプー B&amp;P<br>ブランド：加美乃素<br>販売・製造元：加美乃素本舗<br><br>頭皮ケアしながら洗い上げる薬用シャンプーです。<br>フケ、カユミを防ぎ、頭皮を健やかに保ちます。<br>頭皮・毛髪の皮脂や汚れを取り除き、汗の臭いを防いで、すっきり清潔に洗い上げます。<br>また、保湿成分配合で、頭皮を柔軟に整えます。<br>本品は、頭皮の毛穴をすっきりさせて、育毛剤の浸透を助けるので、育毛剤をお使いの方にとくにおすすめです。<br>300ml入り。<br>医薬部外品です。<br> <br>含有成分精製水、ラウリル硫酸塩、ポリオキシエチレン、ラウリルエーテル硫酸塩、ヤシ油脂肪酸ジエタノールアミド、1,3-ブチレングリコール、ラウリルジメチルアミノ酢酸ベタイン、ジステアリン酸エチレングリコール、ピロクトンオラミン、β-グリチルレチン酸、延命草抽出液、クジン抽出液、ポリオキシエチレンラノリン液、クエン酸、塩化ナトリウム、メントール、エデト酸、サリチル酸塩、黄色4号、緑色3号、香料  シャンプー全部とは髪と頭皮についたホコリ・あせ・皮脂などの汚れを洗い流します。<br><br>日用品／ヘアケア／シャンプー／シャンプー全部<br>JANコード： 4987046870025<br><br>CS：24<br>原産国：日本<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
